<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=\, initial-scale=1.0">
    <title>Iframe</title>
</head>
<body>
    <iframe 
        width="560" height="315" 
        src="https://www.youtube.com/embed/TcBng7YLr2o?si=D7S7tALQR7cAfe6u" 
        title="YouTube video player" 
        frameborder="0" 
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" 
        referrerpolicy="strict-origin-when-cross-origin" 
        allowfullscreen>
    </iframe>
    <br>
    <div>
        <h3>Git Cheat Sheet</h3>
        <iframe width="350" height="300" src="https://education.github.com/git-cheat-sheet-education.pdf" >Git Cheat Sheet</iframe>
    </div>
    
</body>
</html>
